horizontalOffset: dw 0
verticalOffset: dw 0
lineLength: dw 0 ;both vertical or horizonral height/length

clear_screen:
    mov ah, 0x06       ; Scroll up function
    mov al, 0          ; Number of lines to scroll (0 = clear entire screen)
    mov bh, 0x07       ; Video page and attribute (07h = normal text)
    mov cx, 0x0000     ; Upper-left corner of the screen (row 0, col 0)
    mov dx, 0x184F     ; Lower-right corner (row 24, col 79)
    int 0x10           ; Call BIOS interrupt 10h to clear the screen
    ret                ; Return from subroutine

changecolor:
	mov ax, 0x4000
	mov bx, 0
	mov si, 0
	
	iterator:
		mov word[es:si + bx], ax
		add bx, 2
		cmp bx, 11352
		;cmp bx, 264
		jnz iterator
		
	ret
	
	
drawLineVertical:

	; pop word [lineLength]g
	; pop word [verticalOffset]
	; pop word [horizontalOffset]
	
	push ax
	mov ax, 0x7f00; white bg 
	
	mov cx, [lineLength] 
	mov si, [verticalOffset]
	add si, [horizontalOffset]
	
	;add si,2
	
	it1:
		mov word[es:si], ax
		add si,264
		loop it1
	

	pop ax 
ret


drawLineHorizontal:
	
	
	push ax
	mov ax, 0x7f00; white bg 
	
	mov cx, [lineLength] 
	mov si, [verticalOffset]
	add si, [horizontalOffset]
	
	
	it2:
		mov word[es:si], ax
		add si,2
		loop it2
	

	pop ax 
ret


printMainScreen:
	;------------------print S

	;print first horizontal line

	mov word [horizontalOffset],10 ;2 offset
	mov word [verticalOffset], 1320 ; offset 5 characters from top 5*264
	mov word [lineLength],10 ; in characters
	call drawLineHorizontal

	;print left vertical line

	mov word [horizontalOffset],10 ;2 offset
	mov word [verticalOffset], 1584 ; offset 6 characters from top 6*264
	mov word [lineLength],6 ; in characters
	call drawLineVertical

ret


print_welcome_screen:
	call clear_screen
	mov dx, 03c8h; DAC write index register
	mov al, 0 ; Start at color index 0
	out dx, al
	mov dx, 03C9h; DAC data register
	mov cx, 768 ; 256 colors 3 (RGB)
	mov si, frontScreen_palette_data

	set_welcome_palette_loop:

		lodsb
		out dx, al
		loop set_welcome_palette_loop

	;Plot pixels
	mov cx, 64000
	;Number of pixels (320x200)
	mov si, frontScreen_pixel_data
	;Index for pixel data
	xor di, di
	;Start at the beginning of video memory
	rep movsb
	ret

